                                                      "Presenting #HeerRaanjhana song from movie #BachchhanPaandey\nA Nadiadwala Grandson Entertainment Production presents Akshay Kumar In & As 'Bachchhan Paandey' also starring Kriti Sanon, Jacqueline Fernandez, and Arshad Warsi, produced by Sajid Nadiadwala, directed by Farhad Samji.\n\nTo release in cinemas on 18th March 2022.\n\n#SajidNadiadwala Farhad Samji Akshay Kumar Jacqueline Fernandez Kriti Sanon Arshad Warsi Warda Khan Sajid Nadiadwala Nadiadwala Grandson Entertainment - NGE #AroosaKhan #BhushanKumar Ganesh Acharya Amaal Mallik Arijit Singh Shreya Ghoshal Kumaar #AzeemDayani\n#LoveSong #RomanticSong #NewSong #HindiSong2022 #LatestHindiSong #BachchhanPaandeySong \n\nSong Credits:\nSong name : Heer Raanjhana\nMusic Composer  : Amaal Mallik.\nSingers: Arijit Singh, Shreya Ghoshal & Amaal Mallik.\nLyrics: Kumaar.\n\nMusic Team -\nOriginal Soundtrack Themes Written & Composed By Amaal Mallik. \nMusic Producers : Sourav Roy & Amaal Mallik.\nSong Mixed & Mastered By Eric Pillai\nMixing Assistant: Michael Edwin Pillai\nSong Recorded  by Vijay Dayal (Yash Raj Studios) & Rahul Sharma (Studio 504)\nRecording Assistants: Samir Dharap (Studio 504) & Chinmay Mestry (Yrf Studios).\nAcoustic & Electric Guitars: Roland Fernandes.\nLive Rhythms & Percussions Arranged & Performed by Dipesh Varma.\nDholaks : Satyajit Jamsandekar, Rahul Rupawate, Ishteyak khan, Mohammad Shadab.\nTablas : Satyajit Jamsandekar & Rahul Rupawate.\nAdditional Percs : Satyajit Jamsandekar & Dipesh Varma.\nBass : Roland Fernandes.\nMusic Assistants: Ansh Radio, Yash Narvekar, Shishir Samant, Luvdeep Saini (LDS), Riz Shain, Ankush Bhardwaj, Vivek Bharti, Gaurav Sanghvi, Anvay Patil, Rujul Deolikar.\nMusic Label: T-Series",
